script: |
  super -f text -I q5111.spq | sort > q5111.out

inputs:
  - name: q5111.spq
    data: |
      SELECT DISTINCT - + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( col2 - + + CAST ( NULL AS INTEGER ) * + col2 * + + ( 62 ), 25 - CAST ( NULL AS INTEGER ) * + col2 );
  - name: tab2

outputs:
  - name: q5111.out
    data: |
